import './chartExample.css';
// eslint-disable-next-line no-unused-vars
import Chart from "chart.js/auto";
import { Bar } from 'react-chartjs-2';

function Example() {
  return (
    <div>
<Bar
        data={{
          labels: ["circ", "total", "max"],
          datasets: [
            {
              data: [
                'red', 'green','white'
              ],
              backgroundColor: ["#92C63B", "#4CAF4F", "#027F5E"],
              borderColor: ["green"],
            },
          ],
        }}
        height="100"
        width="100"
        options={{
          plugins: {
            legend: {
              labels: {
                font: {
                  size: "7%",
                },
              },
              display: false,
            },
          },
          scales: {
            y: {
              ticks: {
                font: {
                  size: "6.9%",
                },
                display: false,
              },
              beginAtZero: false,
            },
            x: {
              ticks: {
                font: {
                  size: "6.9%",
                },
              },
              beginAtZero: false,
              grid: {
                drawOnCHartArea: false,
                display: false,
                drawBorder: false,
              },
            },
          },
          maintainAspectRatio: false,
        }}
      />
      />
    </div>
  );
}

export default Example;
